// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awHeaderPropsRenderFunction } from 'js/AwHeaderPropsService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwHeaderPropsService', () => import('js/AwHeaderPropsService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awHeaderPropsRenderFunction",
            "deps": "js/AwHeaderPropsService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "header-properties": {
            "type": "object"
        },
        "headerproperties": {
            "type": "object"
        }
    },
    "_viewModelId": "AwHeaderProps",
    "_uniqueViewModelId": "AwHeaderProps",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awHeaderPropsRenderFunction, undefined, ctxImportObj );

export default Component;
